 customers who could not login to GpsGate/RtTracker/Premium','DUNSTAN.NESBIT','2011-11-24 10:19:21','DUNSTAN.NESBIT','2011-11-24 10:19:27','LIVE',1),(10017,'N','DAMIEN.NESBIT','DUNSTAN.NESBIT','GpsGate Login Problems','What are the names of the customers who could not login to GpsGate/RtTracker/Premium','DUNSTAN.NESBIT','2011-11-24 10:19:47','DUNSTAN.NESBIT','2011-11-24 10:19:59','LIVE',1),(10018,'Y','RAENELLE.SAMAROO-MAHARAJ','DUNSTAN.NESBIT','GBIZ System Update','GBIZ has been successfully upgraded, in the next few weeks the other pending components will be rolled out and training done.','DUNSTAN.NESBIT','2012-05-12 19:10:39','DUNSTAN.NESBIT','2012-05-12 19:10:50','LIVE',1),(10019,'Y','DAMIEN.NESBIT','DUNSTAN.NESBIT','GBIZ System Update','GBIZ has been successfully upgraded, in the next few weeks the other pending components will be rolled out and training done.','DUNSTAN.NESBIT','2012-05-12 19:12:17','DUNSTAN.NESBIT','2012-05-12 19:12:30','LIVE',1),(10020,'Y','RAENELLE.SAMAROO-MAHARAJ','DUNSTAN.NESBIT','Basic Server','The rtbasic server is back up. Please double check and ensure that \nall of its customers are on it. All need we to do now is re-program the trackers \nto talk to the new server. Then we we info the customers that the upgrade is\ncomplete','DUNSTAN.NESBIT','2012-05-19 11:13:29','DUNSTAN.NESBIT','2012-05-19 11:13:36','LIVE',1),(10021,'Y','RAENELLE.SAMAROO-MAHARAJ','DUNSTAN.NESBIT','GBIZ Changes','The workflow for putting up a vehicle on the system has changed. \nFollow the steps below:\n1) Add Customer\n2) Create Order (depends on Customer)\n3) Add Device (depends on Order)\n4) Add Vehicle (depends on Customer, Device)\n5) Add SMS User Account (depends on Vehicle)\n6) Add Payment (depends on Order)\n\nCall me if you have any problems','DUNSTAN.NESBIT','2012-05-27 21:50:04','DUNSTAN.NESBIT','2012-05-27 21:53:20','LIVE',1),(10022,'Y','RAENELLE.SAMAROO-MAHARAJ','DUNSTAN.NESBIT','New Invoicing Procedure','System generated invoicing has been installed. Please complete payment \nso that invoice balances will be accurate and a payment details report for \naccounting will be accurate. \nThe link to the invoices are Enquiries->Sales->Order->Invoice\nThe recommended work flow is now \n1) Add Customer Information\n2) Create Order\n3) Add Payment\n4) Complete the other documents','DUNSTAN.NESBIT','2012-07-01 16:05:54','DUNSTAN.NESBIT','2012-07-01 16:06:27','LIVE',1),(10023,'N','DAMIEN.NESBIT','DUNSTAN.NESBIT','New Invoicing Procedure','System generated invoicing has been installed. Please complete the order payments \nso that invoice balances will be accurate and a payment details report for accounting will be accurate. \nThe link to the invoices are Enquiries->Sales->Order->Invoice\nThe recommended work flow is now \n1) Add Customer Information\n2) Create Order\n3) Add Payment\n4) Complete the other documents','DUNSTAN.NESBIT','2012-07-01 16:07:36','DUNSTAN.NESBIT','2012-07-01 16:07:47','LIVE',1);
